description:
Τα προβλήματα της Λιζ ξεκινούν από τότε που έχει την εντύπωση πως κάποιος την παρακολουθεί. Σαν να μην έφτανε αυτό, μία νέα γνωριμία έρχεται για να ταράξει την ήρεμη ζωή της. 
Ποιός είναι ο μυστηριώδης νέος; 
Γιατί αποκτά ξαφνικά θάρρος μαζί της; 
Έχει δίκιο η Λιζ να πιστεύει ότι κρατάει κάποιο καλά κρυμμένο μυστικό;

"When the world stopped, I saw your significance. I saw your beauty. It seems like everything revolves around you."

[ lovely series ]

@JunMyeon09
